eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   sampleEpisodes: () => (/* binding */ sampleEpisodes)\n/* harmony export */ });\nconst sampleEpisodes = [\n    {\n        id: \"1\",\n        title: \"Copernicus AI episode 01: Exploring Black Holes\",\n        description: \"A mathematical exploration of black holes and their properties, examining how Einstein's field equations of general relativity predicted their existence and the fascinating implications of their geometry.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/DB-5I8iuL3A/maxresdefault.jpg\",\n        duration: \"3:10\",\n        date: \"2024-03-19\",\n        url: \"black-holes\",\n        audioUrl: \"/audio/black-holes-podcast.mp3\",\n        videoUrl: \"https://www.youtube.com/watch?v=DB-5I8iuL3A\",\n        descriptUrl: \"https://share.descript.com/view/nnoktPNhPYp\",\n        isFeatured: true,\n        transcript: `\nWelcome to Copernicus AI. I'm Antoni Kowalski, and today we're diving into one of the most fascinating mathematical puzzles in the universe: the geometry of black holes.\n\nA black hole represents a point in space where gravity is so strong that nothing, not even light, can escape. But what's truly remarkable is how mathematics predicted their existence long before we had any observational evidence.\n\nThe story begins with Einstein's field equations of general relativity. These elegant mathematical formulas describe how space and time curve in response to matter and energy. In 1915, just months after Einstein published his theory, Karl Schwarzschild found a solution that described what we now call a black hole.\n\nThe mathematics revealed something extraordinary: a spherical boundary in space-time called the event horizon. Cross this boundary, and the laws of physics as we know them begin to break down.\n\n[...]\n\nThis is Antoni Kowalski for Copernicus AI. Until next time, keep questioning, keep exploring.\n    `.trim()\n    },\n    {\n        id: \"2\",\n        title: \"Biology News - Episode 1\",\n        description: \"The premiere episode of Biology News, covering groundbreaking discoveries in molecular biology, ecology, neuroscience, and evolutionary biology. Features discussions on CRISPR-based gene therapy, coral reef resilience, neural circuit mapping, and evolutionary adaptation in urban wildlife.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"42:15\",\n        date: \"2025-03-28\",\n        url: \"biology-news-ep1\",\n        audioUrl: \"/audio/biology-news-ep1.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Biology News - Episode 1: Transcript\n\n**Publication Date:** March 28, 2025\n\nWelcome to the premiere episode of Biology News, your monthly digest of groundbreaking discoveries across all branches of biological sciences. I'm Maya, your host, and it's Friday, March 28, 2025, 11:11 AM Eastern Standard Time. Today we're bringing you a program designed specifically for biology professionals, researchers, and educators. Each month, we'll deliver concise, rigorous coverage of significant advances in molecular biology, ecology, neuroscience, and evolutionary biology that matter to your research and teaching.\n\nBefore we dive in, let me introduce our team of correspondents. Dr. James specializes in genomics and molecular biology. Dr. Sophia focuses on ecology and conservation biology. Dr. Noah covers neuroscience and behavioral biology. And Dr. Aisha brings expertise in evolutionary biology and biodiversity.\n\nToday's episode features several groundbreaking developments: a revolutionary CRISPR-based gene therapy for sickle cell disease, a comprehensive study on coral reef resilience in the face of climate change, a breakthrough in mapping neural circuits involved in decision-making, and a remarkable discovery about rapid evolutionary adaptation in urban wildlife.\n    `.trim()\n    },\n    {\n        id: \"3\",\n        title: \"Science News - Episode 1\",\n        description: \"The premiere episode of Science News, covering the latest breakthroughs across multiple scientific disciplines. Features discussions on quantum computing, climate science, neuroscience, and materials science advancements that are shaping our understanding of the world.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"45:30\",\n        date: \"2025-03-28\",\n        url: \"science-news-ep1\",\n        audioUrl: \"/audio/science-news-ep1.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Science News - Episode 1: Transcript\n\n**Publication Date:** March 28, 2025\n\nWelcome to the premiere episode of Science News, your comprehensive source for the latest breakthroughs across multiple scientific disciplines. I'm Dr. Marcus Chen, your host, and it's Friday, March 28, 2025, 11:11 AM Eastern Standard Time. Today, we're bringing you a program designed for scientists, researchers, educators, and anyone passionate about scientific advancement.\n\nBefore we begin, let me introduce our team of correspondents. Dr. Elena specializes in physics and astronomy. Dr. James focuses on biology and medicine. Dr. Sophia covers earth and environmental sciences. And Dr. Noah brings expertise in technology and engineering.\n\nIn today's episode, we'll explore several groundbreaking developments: a major advancement in quantum computing that's bringing us closer to quantum advantage, a comprehensive climate study revealing unexpected patterns in ocean circulation, a breakthrough in neuroscience that maps decision-making pathways with unprecedented precision, and a revolutionary new material that could transform energy storage.\n    `.trim()\n    },\n    {\n        id: \"4\",\n        title: \"Computer Science News - Episode 1\",\n        description: \"The premiere episode of Computer Science News, covering the latest breakthroughs in AI, quantum computing, cybersecurity, and software engineering. Features discussions on large language models, quantum algorithms, zero-trust security frameworks, and software development methodologies.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"48:20\",\n        date: \"2025-03-28\",\n        url: \"compsci-news-ep1\",\n        audioUrl: \"/audio/compsci-news-ep1.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Computer Science News - Episode 1: Transcript\n\n**Publication Date:** March 28, 2025\n\nWelcome to the premiere episode of Computer Science News, your monthly digest of groundbreaking developments across all branches of computer science and software engineering. I'm Dr. Marcus Chen, your host, and it's Friday, March 28, 2025, 11:11 AM Eastern Standard Time. Today we're bringing you a program designed specifically for computer scientists, software engineers, IT professionals, and technology enthusiasts. Each month, we'll deliver concise, rigorous coverage of significant advances in artificial intelligence, quantum computing, cybersecurity, and software engineering that matter to your research and development work.\n\nBefore we dive in, let me introduce our team of correspondents. Dr. Elena specializes in artificial intelligence and machine learning. Dr. James focuses on quantum computing and algorithms. Dr. Sophia covers cybersecurity and privacy. And Dr. Noah brings expertise in software engineering and systems architecture.\n\nToday's episode features several groundbreaking developments: a revolutionary advancement in large language models that's pushing the boundaries of AI capabilities, a significant breakthrough in quantum algorithms that could accelerate computational chemistry, a comprehensive framework for zero-trust security that's changing how organizations approach cybersecurity, and a novel software development methodology that's improving productivity and code quality.\n    `.trim()\n    },\n    {\n        id: \"5\",\n        title: \"Physics News - Episode 1\",\n        description: \"The premiere episode of Physics News, covering the latest breakthroughs in quantum physics, astrophysics, condensed matter physics, and applied physics. Features discussions on quantum entanglement, gravitational waves, topological materials, and fusion energy research.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"44:15\",\n        date: \"2025-03-28\",\n        url: \"physics-news-ep1\",\n        audioUrl: \"/audio/physics-news-ep1.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: false,\n        transcript: `\n# Physics News - Episode 1: Transcript\n\n**Publication Date:** March 28, 2025\n\nWelcome to the premiere episode of Physics News, your monthly digest of groundbreaking discoveries across all branches of physics. I'm Dr. Elena Vasquez, your host, and it's Friday, March 28, 2025, 11:11 AM Eastern Standard Time. Today we're bringing you a program designed specifically for physicists, researchers, educators, and physics enthusiasts. Each month, we'll deliver concise, rigorous coverage of significant advances in quantum physics, astrophysics, condensed matter physics, and applied physics that matter to your research and teaching.\n\nBefore we dive in, let me introduce our team of correspondents. Dr. James specializes in quantum physics and quantum information. Dr. Sophia focuses on astrophysics and cosmology. Dr. Noah covers condensed matter and materials physics. And Dr. Marcus brings expertise in applied physics and engineering physics.\n\nToday's episode features several groundbreaking developments: a revolutionary experiment demonstrating quantum entanglement at unprecedented distances, a significant detection of gravitational waves from a neutron star merger, a breakthrough in topological materials with potential applications in quantum computing, and major progress in fusion energy research that brings us closer to commercial fusion power.\n    `.trim()\n    },\n    {\n        id: \"6\",\n        title: \"Chemistry News - Episode 1\",\n        description: \"The premiere episode of Chemistry News, covering the latest breakthroughs in organic chemistry, inorganic chemistry, physical chemistry, and analytical chemistry. Features discussions on sustainable catalysis, novel battery materials, computational chemistry methods, and advanced analytical techniques.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"46:30\",\n        date: \"2025-03-28\",\n        url: \"chemistry-news-ep1\",\n        audioUrl: \"/audio/chemistry-news-ep1.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: false,\n        transcript: `\n# Chemistry News - Episode 1: Transcript\n\n**Publication Date:** March 28, 2025\n\nWelcome to the premiere episode of Chemistry News, your monthly digest of groundbreaking discoveries across all branches of chemistry. I'm Dr. Sarah Johnson, your host, and it's Friday, March 28, 2025, 11:11 AM Eastern Standard Time. Today we're bringing you a program designed specifically for chemists, researchers, educators, and chemistry enthusiasts. Each month, we'll deliver concise, rigorous coverage of significant advances in organic chemistry, inorganic chemistry, physical chemistry, and analytical chemistry that matter to your research and teaching.\n\nBefore we dive in, let me introduce our team of correspondents. Dr. James specializes in organic chemistry and medicinal chemistry. Dr. Sophia focuses on inorganic chemistry and materials science. Dr. Noah covers physical chemistry and computational methods. And Dr. Marcus brings expertise in analytical chemistry and instrumentation.\n\nToday's episode features several groundbreaking developments: a revolutionary sustainable catalysis approach that's transforming industrial processes, a significant breakthrough in battery materials that could increase energy density by 50%, a major advancement in computational chemistry methods that's accelerating drug discovery, and a novel analytical technique that enables single-molecule detection with unprecedented precision.\n    `.trim()\n    },\n    {\n        id: \"7\",\n        title: \"Catalysis Revolution: Transforming Chemical Reactions\",\n        description: 'Explore the remarkable field revolutionizing chemical reactions with \"Catalysis Revolution,\" where we investigate the science of accelerating and directing chemical transformations that\\'s undergoing profound innovation. This episode examines how breakthroughs in catalysis are enabling more sustainable chemical manufacturing, renewable energy technologies, and environmental solutions.',\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"45:30\",\n        date: \"2025-03-28\",\n        url: \"catalysis-revolution\",\n        audioUrl: \"/audio/catalysis-revolution.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Catalysis Revolution: Transforming Chemical Reactions\n\nWelcome to Frontiers of Research. I'm Antoni, and today we're exploring the remarkable field of catalysis that's undergoing a profound revolution. The conversation covers recent breakthroughs in catalyst design and development, industrial applications across multiple sectors, the role of computational methods in accelerating discovery, and how catalytic innovations are enabling more sustainable chemical processes and technologies. Throughout the discussion, we examine how advances in catalysis are addressing critical challenges in energy, environment, and chemical manufacturing.\n\nCatalysis—the process of increasing reaction rates using substances that aren't consumed in the reaction—underlies approximately 90% of all commercially produced chemical products. Recent years have witnessed extraordinary advances across multiple fronts: single-atom catalysts that maximize precious metal efficiency, photocatalysts that harness light energy to drive reactions, electrocatalysts that enable renewable energy storage, and engineered enzymes that perform reactions with unprecedented selectivity. These developments aren't merely incremental improvements but represent potential paradigm shifts in how we produce essential chemicals and materials.\n\nWhat makes this catalysis revolution particularly significant is its potential to address critical sustainability challenges. New catalytic approaches are enabling the activation of traditionally inert molecules like methane, nitrogen, and carbon dioxide—transforming them from waste products or untapped resources into valuable chemical feedstocks. Computational methods and artificial intelligence are dramatically accelerating catalyst discovery and optimization, while biocatalysis is opening new possibilities for green chemistry under mild conditions. Together, these advances are creating pathways toward more energy-efficient, less wasteful chemical processes with reduced environmental impact.\n    `.trim()\n    },\n    {\n        id: \"8\",\n        title: \"Computational Chemistry: Simulating Molecular Reality\",\n        description: \"In this episode of Frontiers of Research, host Antoni explores the revolutionary field of computational chemistry with experts Sarah and Josh. They discuss how advanced algorithms and computing power are transforming our understanding of molecular systems and accelerating discovery across chemistry, materials science, and drug development.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"48:15\",\n        date: \"2025-03-28\",\n        url: \"computational-chemistry\",\n        audioUrl: \"/audio/computational-chemistry.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Computational Chemistry: Simulating Molecular Reality\n\nWelcome to Frontiers of Research. I'm Antoni, and today we're exploring the fascinating field of computational chemistry - where advanced algorithms and computing power are revolutionizing our understanding of molecular systems and transforming how we discover new materials and drugs. I'm joined by my brilliant colleagues Sarah, whose research in quantum chemical methods has been groundbreaking, and Josh, who specializes in applying machine learning to chemical problems.\n\nComputational chemistry is essentially the application of computer science to solve chemical problems and simulate chemical systems. It encompasses a wide range of methods - from quantum mechanical calculations that model electron behavior to molecular dynamics simulations that track atomic movements over time, and more recently, machine learning approaches that can identify patterns in chemical data.\n\nWhat's remarkable about this field is its dramatic evolution. When computational chemistry began in the 1950s and 60s, calculations that we now perform in seconds on a laptop would have required months on the most powerful computers of that era - if they were possible at all. The development has been driven by three parallel advances: First, exponential growth in computing power following Moore's Law, which has given us access to unprecedented computational resources. Second, theoretical breakthroughs in how we model chemical systems, including more accurate approximations and more efficient algorithms. And third, methodological innovations that have expanded the types of problems we can address.\n\nToday, computational chemistry has become an indispensable tool across virtually all areas of chemistry. We can now simulate systems containing thousands of atoms, model reactions with chemical accuracy, predict properties of materials before they're synthesized, and design molecules with specific functions. What's particularly exciting is that we're now at an inflection point where machine learning and artificial intelligence are being integrated with traditional computational chemistry methods, creating hybrid approaches that combine physical insights with data-driven predictions. This convergence is opening entirely new possibilities for molecular design and discovery.\n    `.trim()\n    },\n    {\n        id: \"9\",\n        title: \"Quantum Cryptography and Post-Quantum Security\",\n        description: \"In this episode of Frontiers of Research, host Antoni explores the revolutionary field of quantum cryptography and post-quantum security with experts Dr. Elena Vasquez and Dr. Marcus Chen. They discuss how quantum physics principles are being harnessed to create theoretically unbreakable encryption and how cryptographers are developing classical algorithms that can withstand attacks from quantum computers.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"52:30\",\n        date: \"2025-03-28\",\n        url: \"quantum-cryptography\",\n        audioUrl: \"/audio/quantum-cryptography.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: true,\n        transcript: `\n# Quantum Cryptography and Post-Quantum Security\n\nWelcome to Frontiers of Research. I'm Antoni, and today we're exploring the fascinating world of quantum cryptography and post-quantum security. In an era where quantum computers threaten to break many of our current encryption systems, researchers are racing to develop new methods to keep our data secure. I'm joined by two experts in the field: Dr. Elena Vasquez, a specialist in quantum key distribution systems, and Dr. Marcus Chen, whose work focuses on post-quantum cryptographic algorithms.\n\nQuantum cryptography represents a fundamental shift in how we approach secure communication. Unlike traditional cryptography, which relies on mathematical complexity to secure data, quantum cryptography leverages the principles of quantum mechanics - specifically, the behavior of particles at the quantum level - to achieve security. The most developed application is Quantum Key Distribution, or QKD, which allows two parties to produce a shared random secret key known only to them, which can then be used to encrypt and decrypt messages.\n\nWhat makes quantum cryptography revolutionary is that its security is based on the fundamental laws of physics rather than computational hardness assumptions. In traditional cryptography, we rely on the fact that certain mathematical problems are difficult to solve - like factoring large numbers in the case of RSA encryption. But with quantum cryptography, we rely on principles like the Heisenberg uncertainty principle and the no-cloning theorem.\n\nThe Heisenberg uncertainty principle tells us that measuring a quantum system disturbs it, while the no-cloning theorem proves that it's impossible to create an identical copy of an unknown quantum state. Together, these principles mean that any attempt by an eavesdropper to intercept and measure quantum information will inevitably introduce detectable changes. This gives quantum cryptography a unique advantage: the ability to detect eavesdropping attempts with certainty.\n    `.trim()\n    },\n    {\n        id: \"10\",\n        title: \"The Future of AI Agents\",\n        description: \"Exploring how autonomous AI agents are evolving and their potential impact on various industries. Discussion of latest breakthroughs.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/DB-5I8iuL3A/maxresdefault.jpg\",\n        duration: \"28:45\",\n        date: \"2024-02-27\",\n        url: \"ai-agents\",\n        audioUrl: \"/audio/episode2.mp3\",\n        videoUrl: \"https://www.youtube.com/watch?v=DB-5I8iuL3A\",\n        isFeatured: false\n    },\n    {\n        id: \"11\",\n        title: \"AI in Scientific Research\",\n        description: \"How artificial intelligence is accelerating scientific discoveries and transforming research methodologies across disciplines.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/DB-5I8iuL3A/maxresdefault.jpg\",\n        duration: \"35:20\",\n        date: \"2024-03-05\",\n        url: \"ai-in-research\",\n        audioUrl: \"/audio/episode3.mp3\",\n        videoUrl: \"https://www.youtube.com/watch?v=DB-5I8iuL3A\",\n        isFeatured: false\n    },\n    {\n        id: \"12\",\n        title: \"Testing Image Error Handling\",\n        description: \"This episode has an invalid image URL to test our placeholder.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/DB-5I8iuL3A/maxresdefault.jpg\",\n        duration: \"25:30\",\n        date: \"2024-03-12\",\n        url: \"test-error\",\n        audioUrl: \"/audio/episode4.mp3\",\n        videoUrl: \"https://www.youtube.com/watch?v=DB-5I8iuL3A\",\n        isFeatured: false\n    },\n    {\n        id: \"13\",\n        title: \"Audio Test\",\n        description: \"This is a test episode to verify audio playback functionality.\",\n        thumbnailUrl: \"https://img.youtube.com/vi/placeholder/maxresdefault.jpg\",\n        duration: \"0:05\",\n        date: \"2025-03-28\",\n        url: \"audio-test\",\n        audioUrl: \"/audio/test.mp3\",\n        videoUrl: null,\n        descriptUrl: null,\n        isFeatured: false,\n        transcript: `\n# Audio Test\n\nThis is a simple test episode with a 5-second sine wave audio file to verify that audio playback is working correctly.\n    `.trim()\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./src/data/sampleEpisodes.ts\n");

